import { createSlice } from '@reduxjs/toolkit'
import { NavLink } from "react-router-dom";
import "./navSliceMobile.css"
const initialState = {
  value: '',
}

export const navSliceMobile = createSlice({
  name: 'navBarMobile',
  initialState,
  reducers: {
    ledger_mobileNav: (state) => {
        state.value =<> 
            <li className='mobile_navs' id='apps'></li>
            <li className='mobile_navs' id='search'></li>
            <li className='mobile_navs' id='notifications'></li>
            <li className='mobile_navs' id='profile'></li>
            <li className='mobile_navs' id='options'></li>
        </>
    },

    ledger_subPages_mobileNav: (state) => {
        state.value =<> 
            <li className='mobile_navs' id='apps'></li>
            <li className='mobile_navs' id='notifications'></li>
            <li className='mobile_navs' id='profile'></li>
            <li className='mobile_navs' id='options'></li>
        </>
    },

    clear_mobileNav: (state) => {
        state.value =<></>
    },
  },
})

// Action creators are generated for each case reducer function
export const { ledger_mobileNav, ledger_subPages_mobileNav, clear_mobilwnav} = navSliceMobile.actions

export default navSliceMobile.reducer
